//Makes an object grabbable v1.1 - Fayelure

let Distance_to_player=0.5 // How far the object is relative to the player (negative will be behind)
let up_down_constant= -0.65  // Positive object will go higher, negative will go lower. eg: -0.65 places the object where your hands are, approximately. 0 will place the object right above your eyes.
let refresh_rate = 50       // Number of milliseconds. Please avoid a refresh rate < 30 as it could crash the grid.

let clone = true; // change this to false if you want to not clone the object.

//-------------- Do not touch ---------------------------

function moveObject(object,player){ // calculates new position of object

  let spherePos = object.position;
  let playerRotation = player.rotation;

  let xDelta = Distance_to_player*Math.cos(-playerRotation.y+Math.PI/2 + Math.PI);
  let yDelta = Distance_to_player*Math.tan(playerRotation.x);
  let zDelta = Distance_to_player*Math.sin(-playerRotation.y+Math.PI/2 + Math.PI);

      var positionRell = [
    player.position.x - xDelta,
    player.position.y - yDelta +(up_down_constant),
    player.position.z - zDelta
  ];

return positionRell
}

function setPosition(newobject,e){ // refreshes the positions
    newobject.set({position:moveObject(newobject,e.player)})
  if(!newobject.position || !newobject.rotation){
    parcel.removeFeature(newobject)
  }else{
  setTimeout(()=>{
    setPosition(newobject,e)
  },refresh_rate)
  }
}

feature.on('click',e=>{ // On click, create new object and start refreshing the position
let newobject = feature
if(clone){
newobject = parcel.createFeature('vox-model')
newobject.set({scale:[feature.scale.x,feature.scale.y,feature.scale.z]})

newobject.set({url:feature._content.url})
newobject.position=feature.position
newobject.rotation=feature.rotation
}

setPosition(newobject,e)

})

let ball, paddle, frame, blocks

feature.on('keys', e => {
  if (e.keys.left) {
    paddle.moveLeft()
  } else if (e.keys.right) {
    paddle.moveRight()
  }
})

feature.on('start', e => {
  reset()
})

feature.on('frame', e => {
  frame += 1
  update()
  draw()
})

function update() {
  ball.update()
}

function draw() {
  feature.screen.fill(0)

  ball.draw()
  paddle.draw()
  for (j = 0; j < blocks.length; j ++) {
    blocks[j].draw()
  }
}

function reset() {
  ball = new Ball(Math.round(Math.random() * 64), 32)
  paddle = new Paddle(29, 60, 6)
  frame = 0
  blocks = []
  for (y = 0; y < 5; y ++) {
    for (z = 0; z < 8; z ++) {
      blocks.push(new Block(Math.floor(feature.screenWidth / 8 * z + 2), y * 4 + 2, 5, 3))
    }
  }
  draw()
}

// classes

class Ball {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y

    this.xVel = Math.random() > 0.5 ? 1 : -1
    this.yVel = 1
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    // wall collision detection

    if (this.xPos + this.xVel > 63 || this.xPos + this.xVel < 0) {
      this.xVel *= -1
    }
    if (this.yPos + this.yVel < 0) {
      this.yVel *= -1
    }
    if (this.yPos + this.yVel > 63) {
      reset()
    }

    // paddle collision detection

    if ((this.yPos + this.yVel == paddle.yPos)) {
      let nextX = this.xPos + this.xVel
      if (nextX >= paddle.xPos && nextX <= paddle.xPos + paddle.width) {
        this.yVel *= -1
      }
    }

    // block collision detection

    for (let i = 0; i < blocks.length; i ++) {
      let block = blocks[i]
      let nextX = this.xPos + this.xVel
      let nextY = this.yPos + this.yVel

      if (nextX >= block.x && nextX < block.x + block.width && nextY >= block.y && nextY < block.y + block.height) {
        if (this.xPos < block.x || this.xPos > block.x + block.width - 1) {
          this.xVel *= -1
        }
        if (this.yPos < block.y || this.yPos > block.y + block.height - 1) {
          this.yVel *= -1
        }

        blocks.splice(i, 1)
        break
      }
    }

    // update position

    this.xPos += this.xVel
    this.yPos += this.yVel
  }

  draw() {
    for (let i = 0; i < 3; i ++) {
      feature.screen[this.yPos * feature.screenWidth * 3 + this.xPos * 3 + i] = 255
    }
  }
}

class Paddle {
  constructor(x, y, w) {
    this.xPos = x
    this.yPos = y
    this.width = w
  }

  draw() {
    for (let i = this.yPos * feature.screenWidth * 3 + this.xPos * 3; i < this.yPos * feature.screenWidth * 3 + (this.xPos + this.width) * 3 + 3; i ++) {
      feature.screen[i] = 255
    }
  }

  moveLeft() {
    if (this.xPos > 0) {
      this.xPos -= 1
      draw()
    }
  }

  moveRight() {
    if (this.xPos + this.width < 63) {
      this.xPos += 1
      draw()
    }
  }
}

class Block {
  constructor(x, y, w, h) {
    this.x = x
    this.y = y
    this.width = w
    this.height = h
  }

  draw() {
    // horizontal lines
    for (let i = 0; i < this.width; i++) {
      feature.screen[this.y * feature.screenWidth * 3 + (this.x + i) * 3] = 255
      feature.screen[(this.y + this.height - 1) * feature.screenWidth * 3 + (this.x + i) * 3] = 255
    }

    // vertical lines
    for (let i = 0; i < this.height; i++) {
      feature.screen[(this.y + i) * feature.screenWidth * 3 + this.x * 3] = 255
      feature.screen[(this.y + i) * feature.screenWidth * 3 + (this.x + this.width - 1) * 3] = 255
    }
  }
}

